-- PRocess name change

Update META_RAW.PROCESS set PROCESS_NAME=Replace(PROCESS_NAME,'id_mds_refresh','INDONESIA_MDS_SDL_MDS')
where SOURCE_ID in (2,5) and USECASE_ID='213';

Update META_RAW.PROCESS set PROCESS_NAME=Replace(PROCESS_NAME,'id_mds_sdl_refresh','INDONESIA_MDS_SDL_SDL_MDS')
where SOURCE_ID in (2,5) and USECASE_ID='214';


-- Delete existing META_RAW.PARAMETERS and re-insert to follow on the MDS standard

DELETE FROM META_RAW.PARAMETERS where PARAMETER_GROUP_NAME like 'id_mds_refresh%';
DELETE FROM META_RAW.PARAMETERS where PARAMETER_GROUP_NAME like 'id_mds_sdl_refresh%';


